import spriteConfig from './jas-sprite.json';

const sprite = 'data:image/png;base64,'

type SpriteConfigType = {
    frames: Array<{
        "filename": string,
        "frame": { "x": number, "y": number, "w": number, "h": number },
        "rotated": boolean,
        "trimmed": boolean,
        "spriteSourceSize": { "x": number, "y": number, "w": number, "h": number },
        "sourceSize": { "w": number, "h": number }
    }>,
    meta: {
        "app": string,
        "version": string,
        "image": string,
        "format": string,
        "size": { "w": number, "h": number },
        "scale": string,
        "smartupdate": string
    }
}

type ImageDataType = { data: ImageData, url: string };
type GetImagesCallback = (images: Map<string, ImageDataType>) => void;
const sprite_images_cache = new Map<string, Map<string, ImageDataType>>();

function getSpriteImages(base64Image: string, config: SpriteConfigType, callback: GetImagesCallback) {
    if (sprite_images_cache.has(config.meta.image)) {
        callback(sprite_images_cache.get(config.meta.image)!);
        return;
    }

    const image = new Image();
    image.onload = () => {
        const canvas = document.createElement('canvas')
        const canvas_ctx = canvas.getContext('2d')!;
        canvas.height = config.meta.size.h;
        canvas.width = config.meta.size.w;
        canvas_ctx.drawImage(image, 0, 0);

        const spriteImages = new Map<string, ImageDataType>();
        const c = document.createElement('canvas');
        const cctx = c.getContext('2d')!;

        config.frames.forEach(item => {
            const { x, y, w, h } = item.frame;
            const data = canvas_ctx.getImageData(x, y, w, h);
            c.height = h;
            c.width = w;
            cctx.putImageData(data, 0, 0);
            spriteImages.set(item.filename, {
                data,
                url: c.toDataURL('image/png')
            });
        });

        sprite_images_cache.set(config.meta.image, spriteImages);
        callback(spriteImages);
    }

    image.src = base64Image;
}

export function getMapMarkerSpriteImages(callback: GetImagesCallback) {
    getSpriteImages(sprite, spriteConfig, callback);
}